import "./App.css";

function App() {
  const userLoggedRole = "client"; // TODO: traer info del padre

  return (
    <div className='App'>
      {userLoggedRole == "client" && (
        <AppointmentsListClient></AppointmentsListClient>
      )}

      {userLoggedRole == "admin" && (
        <AppointmentsListAdmin></AppointmentsListAdmin>
      )}
    </div>
  );
}

export default App;
